3. Maßnahmen zur Heranziehung eines fachlich tüchtigen,

national und sozial einwandfreien Nachwuchses zu

treffen;


4. über geschäftliche Vorgänge, Herstellungsarten, Muster,

sowie sonstige Geschäfts- und Betriebsgeheimnisse

strengste Verschwiegenheit zu wahren;

5. Arbeitsplatz, Maschinen, Werkzeuge und die gesund
heitlichen Einrichtungen des Betriebes in Ordnung
zu halten;

1. infolge Anweisung der Reichsregierungm Landesre
gierung oder je der höchsten Reichs- oder Landes-PO-
bzw. SA-Dienststellen der NSDAP;



3. wegen Betriebsunfalles oder Erkrankung für die Dauer

von 3 Tagen, wenn die Erwerbsunfähigkeit wenigstens

2 Wochen anhält;

4. infolge Wohnungswechsels, eigener Hochzeit und Hoch
zeit von Kindern, Stief- und Pflegekindern und infolge
Niederkunft der Ehefrau für die Dauer eines Tages;



6. die dem Betrieb geschuldeten Schadenersatzbeträge,

soweit sie der Lohn- oder Gehaltspfändung unterliegen

und anerkannt oder gerichtlich festgestellt sind;


6. Mitnahme von Gegenständen (§ 37 Ziffer 3);

Wiederholte Verstöße dieser Art haben Ausschluß aus

der Betriebsgemeinschaft zur Folge.
